describe("Test SplitOnJSON", () => {
    function log(data: any) {
        return; // NO logging
        //console.log("got data");
        //console.log(data.toString());
        //let obj = JSON.parse(data);
        //console.log("as JSON");
        //console.log(obj);
    }
    it("oneJSON", (done) => {
        let splitter = new SplitStreamOnNewJSON();
        splitter.on('data', (data: any) => {
            log(data);
            let obj = JSON.parse(data);
            if (obj.test == "result") done();
        })
        splitter.lookForJSON(new Buffer('{"test":"result"}'));
    });
    it("oneJSONWithNoiseAtStart", (done) => {
        let splitter = new SplitStreamOnNewJSON();
        splitter.on('data', (data: any) => {
            log(data);
            let obj = JSON.parse(data);
            if (obj.test == "result") done();
        })
        splitter.lookForJSON(new Buffer('sge wr{"test":"result"}'));
    });
    it("twoJSON", (done) => {
        let splitter = new SplitStreamOnNewJSON();
        splitter.on('data', (data: any) => {
            log(data);
            let obj = JSON.parse(data);
            if (obj.test2 == "final") done();
        })
        splitter.lookForJSON(new Buffer('{"test":"result"}{"test2":"final"}'));
    });
    it("twoJSONWithNoiseAll", (done) => {
        let splitter = new SplitStreamOnNewJSON();
        splitter.on('data', (data: any) => {
            log(data);
            let obj = JSON.parse(data);
            if (obj.test2 == "final") done();
        })
        splitter.lookForJSON(new Buffer('e wrv{"test":"result"}fd gs{"test2":"final"}req '));
    });
    it("twoJSONSplit", (done) => {
        let splitter = new SplitStreamOnNewJSON();
        splitter.on('data', (data: any) => {
            log(data);
            let obj = JSON.parse(data);
            if (obj.test2 == "final") done();
        })
        splitter.lookForJSON(new Buffer('{"test":"result"}{"tes'));
        splitter.lookForJSON(new Buffer('t2":"final"}'));
    });
    it("twoJSONSplitWithNoise", (done) => {
        let splitter = new SplitStreamOnNewJSON();
        splitter.on('data', (data: any) => {
            log(data);
            let obj = JSON.parse(data);
            if (obj.test2 == "final") done();
        })
        splitter.lookForJSON(new Buffer('345 {"test":"result"} dfsg{"tes'));
        splitter.lookForJSON(new Buffer('t2":"final"} asd '));
    });
    it("complicatedJSON", (done) => {
        let splitter = new SplitStreamOnNewJSON();
        splitter.on('data', (data: any) => {
            log(data);
            let obj = JSON.parse(data);
            if (obj.test2 == "final") done();
        })
        splitter.lookForJSON(new Buffer('asdf {"test":"result"} sdr{}sf {"tes'));
        splitter.lookForJSON(new Buffer('tsplit":"yep"}ebv {"test2":"final" }dsaf'));
    });
    it("complicatedJSON with LOTS OF NOISE", (done) => {
        let splitter = new SplitStreamOnNewJSON();
        splitter.on('data', (data: any) => {
            log(data);
            let obj = JSON.parse(data);
            if (obj.test2 == "final") done();
        })
        splitter.lookForJSON(new Buffer('  {"test":"result"} sdr{}sf {"tes'));
        splitter.lookForJSON(new Buffer('tsplit":"yep"} {"test2":"final" }dsaf'));
    });
});

